  let parentOffset = $('.small_news_box').offset();
  let relX = e.pageX - parentOffset.left;
  let relY = e.pageY - parentOffset.top;
  let boxWidth = $('.small_news_box').width();
  let boxHeight = $('.small_news_box').height();
  if(relX >= 0 && relX <= boxWidth && relY >= 0 && relY <= boxHeight) {
      $('#small_news_filters').css({
          left:  relX,
          top:   relY
      });
  }
});
